import React, { useState } from 'react';
import axios from 'axios';

const SignIn = () => {
    const [inputdata, setInputdata] = useState("");
    const [password, setPassword] = useState("");
    const [userdata, setUserData] = useState([]);

    const handleSubmit = async (e) => {
      e.preventDefault();

      try {
        const response = await axios.post('localhost:3000/users/signin', inputdata, password, userdata);
        console.log(response.data);
      } catch (error) {
        console.error(error);
      }
    };
    return (
      <>
        <h1>Login page</h1>
        <label>Enter your email</label>
        <input placeholder='email id' value={inputdata} onChange={(e)=> setInputdata(e.target.value)}/>
        <label>Enter your password</label>
        <input placeholder='password' value={password} onChange={(e)=> setPassword(e.target.value)}/>
        <label>Enter your username</label>
        <input placeholder='username' value={userdata} onChange={(e)=> setUserData(e.target.value)}/>
        <button onClick={handleSubmit}/>


      </>
    )    
};

export default SignIn;
